SELECT CAST(EXTRACT(MONTH FROM generico_5.fecha) AS LONG) AS mnfechaok FROM generico_5 WHERE ((generico_5.anunciante IN ('BANTRAB/TODOTICKET', 'TODOTICKET', 'TODOTICKET.COM')) AND (CAST(EXTRACT(YEAR FROM generico_5.fecha) AS LONG) >= 2010) AND (CAST(EXTRACT(YEAR FROM generico_5.fecha) AS LONG) <= 2015)) GROUP BY mnfechaok ORDER BY mnfechaok ASC ;
